contracts/StandardICO.sol.content:
//SPDX-License-Identifier: Unlicense
pragma solidity ^0.8.9;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Context.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

address payable constant feeAddress = payable(0x75280424f429feF999c56eb0C2CC2F9095c0Cf05);

contract Presale is ReentrancyGuard, Context, Ownable {
  using SafeMath for uint256;
  
  /* ========== STATE VARIABLES ========== */
  mapping (address => bool) private isAdmin;

  mapping (address => uint256) private contributions;
  uint256 private contributors;
  uint256 private amountRaised; // Auto Calc


  mapping (address => uint256) private rewards;
  uint256 private referrerCount;
  uint256 private currentReward;
  uint256 private minReward;


  IERC20 private token;
  address payable private wallet;
  uint256 private decimals;
  uint256 private poolFee;
  uint256 private affiliate;
  uint256 private softCap;
  uint256 private startTime;
  uint256 private endTime;
  uint256 private anticipatedRate;
  uint256 private presaleTokens;
  bool private startRefund = false;
  
  uint private status = 1; // Auto Calc

/* ========== MODIFIERS ========== */
  modifier onlyAdmin() {
    require(isAdmin[_msgSender()], "ICO: only Admin can call this functionality");
    _;
  }

  modifier Active() {
    require(endTime > 0 && block.timestamp < endTime && startTime > 0 && block.timestamp > startTime, "ICO must be active");
    _;
  }

  modifier NotStarted() {
    require(block.timestamp < startTime, "ICO already began");
    _;
  }
  
  modifier NotActive() {
    require(endTime < block.timestamp && startTime > block.timestamp, 'ICO should not be active');
    _;
  }
  /* ========== CONSTRUCTOR ========== */
  constructor (IERC20 _token,uint256 _decimals,uint256 _poolFee,uint256 _affiliate,uint256 _softCap,uint256 _anticipatedRate,uint256 _startTime,uint256 _endTime,uint256 tokens) payable {
    require(address(_token) != address(0), "Pre-Sale: token is the zero address");
    require(msg.value > 0, 'Insufficient Funds');
    feeAddress.transfer(msg.value);
    wallet = payable(_msgSender());
    token = _token;
    decimals = _decimals;
    poolFee = _poolFee;
    affiliate = _affiliate;
    softCap = _softCap;
    anticipatedRate = _anticipatedRate;
    startTime = _startTime;
    endTime = _endTime;
    presaleTokens = tokens;
    isAdmin[owner()] = true;
  }

  /* ========== VIEWS FUNCTIONS ========== */
  // Public View

  // status /Sale Live = 1 / Upcoming = 2 / Ended = 3 / Cancelled = 4
  function getRaised() public view returns (uint256) {    
    return amountRaised;
  }

  function getStatus() public view returns (uint) {    
    return status;
  }

  function getToken() public view returns (address) {    
    return address(token);
  }

  function getCurrentRate() public view returns (uint256) {    
    return presaleTokens.mul(10**18).div(contributors);
  }

  function getPresaleTokens() public view returns (uint256) {    
    return presaleTokens;
  }

  function getSoftCap() public view returns (uint256) {    
    return softCap;
  }

  function getContributors() public view returns (uint256) {    
    return contributors;
  }

  function getAffiliatePercentage() public view returns (uint256) {    
    return affiliate;
  }

  function getAnticipatedRate() public view returns (uint256) {    
    return anticipatedRate;
  }

  function getReferrerCount() public view returns (uint256) {    
    return referrerCount;
  }

  function getCurrentReward() public view returns (uint256) {    
    return currentReward;
  }

  function getMinReward() public view returns (uint256) {    
    return minReward;
  }

  // Address Specific
  function getContribution(address beneficiary) public view returns (uint256) {    
    return contributions[beneficiary];
  }

  function getReward(address beneficiary) public view returns (uint256) {    
    return rewards[beneficiary];
  }

  /* ========== SETTER FUNCTIONS ========== */

  function setAnticipatedRate(uint256 value) external onlyAdmin{
    anticipatedRate = value;
  }

  function setSoftCap(uint256 value) external onlyAdmin{
    softCap = value;
  }

  function setStartTime(uint256 value) external onlyAdmin NotStarted{
    startTime = value;
  }

   function setEndTime(uint256 value) external onlyAdmin{
    endTime = value;
  }

  function setAffiliatePercentage(uint256 value) external onlyAdmin{
    affiliate = value;
  }

  /* ========== ACTION FUNCTIONS ========== */

  // Contribute
  function contribute(address beneficiary) external nonReentrant Active payable {
    //uint256 weiAmount = msg.value;
    //_preValidatePurchase(beneficiary, weiAmount);
    //uint256 tokens = _getTokenAmount(weiAmount);
    //userTokens[beneficiary] =  userTokens[beneficiary].add(tokens);
    //_weiRaised = _weiRaised.add(weiAmount);
    //availableTokensICO = availableTokensICO - tokens;
    //_contributions[beneficiary] = _contributions[beneficiary].add(weiAmount);
    
    //emit TokensPurchased(_msgSender(), beneficiary, weiAmount, tokens);
  }
  // Claim Tokens
  // Emergency Withdraw 10% Penalty
  // Cancel Pool - implication: refund

  /* ========== RESTRICTED FUNCTIONS ========== */
  function addAdmin(address _admin) external onlyOwner {
    require(_admin != address(0), "address is zero");
    isAdmin[_admin] = true;
  }

  function removeAdmin(address _admin) external onlyOwner {
    require(_admin != address(0), "address is zero");
    isAdmin[_admin] = false;
  }
    
  /* ========== INTERNAL HELPER FUNCTIONS ========== */
}

contracts/StandardToken.sol.content:
//SPDX-License-Identifier: Unlicense
pragma solidity ^0.8.9;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

address payable constant feeAddress = payable(0x75280424f429feF999c56eb0C2CC2F9095c0Cf05);
contract Standard is ERC20{
    constructor (string memory __name,string memory __symbol,uint256 _totalSupply,uint256 _decimal) payable  ERC20(__name, __symbol){
        require(msg.value > 0, 'Insufficient Funds');
         feeAddress.transfer(msg.value);
         _mint(msg.sender, _totalSupply * (10 ** uint256(_decimal)));
    }
}

